import imageone from './img/pic10.png'
import imagetwo from './img/woodlawn2.png'
import { Link, useNavigate } from 'react-router-dom'
import './cotcstyle.css';




  
  
function Homey() {
	
	let navigate = useNavigate();
	
	const navstore = () => {
   
    navigate('/store');
  };
  return (
  <body className="site">
<div className="bgmood">
    <div className="div1"> <h1 className="bgtext">About Children of the corn</h1> </div>
	<div className="div1"> <h1 className="bgtext">Games</h1> </div>
	<div className="div1"> <h1 className="bgtext">Film</h1> </div>
	<div className="div1"> <h1 className="bgtext">The Woodlawn Story </h1> 
	<img src={imagetwo} className = "im1" /></div>
	<button className="div1" onClick={navstore}> <h1 className="bgtext">Contact</h1> </button>
	
	</div>
	
	
	
	
	</body>
	
  );
}

function Contactp() {
	
	console.log("worked");
	
}

export default Homey;
